import React from 'react';
import ReactDOM from 'react-dom';
//import App from './components/App';

let BlackBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "black",
  fontSize: "30px",
  textAlign: "center",
  color: "yellow",
  padding: "100px",
  float: "left"
}
/*Red box style*/
let RedBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "red",
  fontSize: "30px",
  textAlign: "center",
  color: "blue",
  padding: "100px",
  float: "left"
}
/*Green Box style*/
let GreenBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "green",
  fontSize: "30px",
  textAlign: "center",
  color: "white",
  padding: "100px",
  float: "left"
}


let BlackBox = () => <div style = {BlackBoxStyle}> Yellow In Black </div>;
let RedBox = () => <div style = {RedBoxStyle}> Blue In Red </div>;
let GreenBox = () => <div style = {GreenBoxStyle}> White In Green </div>;
function App() {

  return (
    <div>
      <BlackBox/>
      <RedBox/>
      <GreenBox/>
    </div>
  );
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
